import React , {Fragment} from 'react';
import spinner from './spinner.gif';
import gif from './giphy.gif';


export default function Spinner() {
    return (
        <Fragment>
            <img
            src = {gif}
            style = {{ width: '500px' , margin: 'auto' , display: 'block' }}
            alt = 'Loading...'
            />
        </Fragment>
    )
}
